{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amirmotefaker/sentiment-analysis-model-using-r?scriptVersionId=148726869\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# What is Sentiment Analysis?\n- Sentiment analysis is the process of analyzing digital text to determine if the emotional tone of the message is positive, negative, or neutral. Today, companies have large volumes of text data like emails, customer support chat transcripts, social media comments, and reviews. Sentiment analysis tools can scan this text to automatically determine the author’s attitude towards a topic. Companies use the insights from sentiment analysis to improve customer service and increase brand reputation. \n# Why is sentiment analysis important?\n - Provide objective insights\n - Build better products and services\n - Analyze at scale\n - Real-time results\n \n# What are sentiment analysis use cases?\n  - Improve customer service\n  - Brand monitoring\n  - Market research\n  - Track campaign performance\n  \n# What are the different types of sentiment analysis?\n - Fine-grained scoring\n - Aspect-based\n - Intent-based\n - Emotional detection\n \n\n##### Reference : [Amazon](https://aws.amazon.com/what-is/sentiment-analysis/)\n\n\n# Sentiment Analysis Model:\n- We will carry out sentiment analysis with R in this project. The dataset that we will use will be provided by the R package ‘janeaustenR’.\n\n## janeaustenr: Jane Austen's Complete Novels:\n- Full texts for Jane Austen's 6 completed novels, ready for text analysis. These novels are \"Sense and Sensibility\", \"Pride and Prejudice\", \"Mansfield Park\", \"Emma\", \"Northanger Abbey\", and \"Persuasion\". [janeaustenr](https://cran.r-project.org/web/packages/janeaustenr/index.html)\n\n\n- In order to build our project on sentiment analysis, we will make use of the tidytext package that comprises sentiment lexicons that are present in the dataset of ‘sentiments’.","metadata":{"_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","_execution_state":"idle"}},{"cell_type":"markdown","source":"# Install Libraries","metadata":{}},{"cell_type":"code","source":"install.packages(\"janeaustenr\")\ninstall.packages(\"tidytext\")","metadata":{"execution":{"iopub.status.busy":"2023-10-31T11:13:03.933815Z","iopub.execute_input":"2023-10-31T11:13:03.935978Z","iopub.status.idle":"2023-10-31T11:13:38.764106Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"# Import Libraries","metadata":{}},{"cell_type":"code","source":"library(tidytext)","metadata":{"execution":{"iopub.status.busy":"2023-10-31T11:13:38.767026Z","iopub.execute_input":"2023-10-31T11:13:38.801166Z","iopub.status.idle":"2023-10-31T11:13:40.163903Z"},"trusted":true},"execution_count":2,"outputs":[]},{"cell_type":"code","source":"sentiments","metadata":{"execution":{"iopub.status.busy":"2023-10-31T11:13:40.167708Z","iopub.execute_input":"2023-10-31T11:13:40.169613Z","iopub.status.idle":"2023-10-31T11:13:40.249137Z"},"trusted":true},"execution_count":3,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6786 × 2</caption>\n<thead>\n\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>2-faces      </td><t